    public function getSourceContext()
    {
        return new Source("{% extends 'base.html.twig' %}

{% block title %}Connexion{% endblock %}

{% block content %}

    <div class=\"block-login\">
    
        <form method=\"post\">
            {% if error %}
                <div class=\"alert alert-danger\">{{ error.messageKey|trans(error.messageData, 'security') }}</div>
            {% endif %}

            {% if app.user %}
                <div class=\"mb-3\">
                    Vous etes connectes sur {{ app.user.email }} <a href=\"{{ path('app_logout') }}\">Deconnexion</a>
                </div>
            {% endif %}

            <h1 class=\"h3 mb-3 font-weight-normal\">Merci de vous connecter</h1>
            <label for=\"inputEmail\">Email</label>
            <input type=\"email\" value=\"{{ last_username }}\" name=\"email\" id=\"inputEmail\" class=\"form-control\" placeholder=\"Votre email\" required autofocus>
            <label for=\"inputPassword\" class=\"mt-2\">Mot de passe</label>
            <input type=\"password\" name=\"password\" id=\"inputPassword\" class=\"form-control\" placeholder=\"Votre mot de passe\" required>

            <input type=\"hidden\" name=\"_csrf_token\" value=\"{{ csrf_token('authenticate') }}\">

            {#
                Uncomment this section and add a remember_me option below your firewall to activate remember me functionality.
                See https://symfony.com/doc/current/security/remember_me.html

                <div class=\"checkbox mb-3\">
                    <label>
                        <input type=\"checkbox\" name=\"_remember_me\"> Remember me
                    </label>
                </div>
            #}

            <button class=\"btn btn-block btn-primary mt-3\" type=\"submit\">
                Connexion
            </button>

            <hr>

            <p class=\"text-center\"><a href={{ path('reset_password') }}>Mot de passe oublie</a>?</p>
            <p class=\"text-center\">Ou souhaitez-vous <a href={{ path('register') }}>creer un compte </a>?</p>
        </form>

    </div>


{% endblock %}
", "security/login.html.twig", "C:\\Users\\Utilisateur\\Desktop\\Symfony\\OmiyaProject\\Omiya-Site-Ecommerce-main\\templates\\security\\login.html.twig");
